import 'package:innaya_app/features/feature_auth/domain/entity/entity_user.dart';class User extends EntityUser{  User({int? id,  String? image_url,  String? name,  String? email,  String ?mobileCode,  String ?mobile,  String ?otpCode,String ?otp_verify}      ):super(      id:id,image_url:image_url,name:name,email:email,mobileCode:mobileCode,mobile:mobile,otpCode:otpCode,otp_verify:otp_verify  );  factory User.fromJson(Map<String, dynamic> json) => User(    id: json["id"],    image_url: json["image_url"]==null?"":json["image_url"],    name: json["name"],    email: json["email"],    mobileCode: json["mobile_code"],    otpCode:json["otp_code"]==null?"" :json["otp_code"].toString(),    otp_verify: json["otp_verify"].toString(),  );  Map<String, dynamic> toJson() => {    "id": id,    "image_url": image_url,    "name": name,    "email": email,    "mobile_code": mobileCode,    "mobile": mobile,    "otp_code": otpCode,    "otp_verify": otp_verify,  };}